import React from "react";
import { Container, Table } from "react-bootstrap";
import "./style.css";
const App = () => {
  const students = [
    { name: "waliullah", email: "waliullag@gmail.com", contact: 1742572220 },
    { name: "Habiba", email: "Habiba@gmail.com", contact: 1742572220 },
    { name: "Ayesha", email: "Ayesha@gmail.com", contact: 1742572220 },
    { name: "Fatima", email: "Fatima@gmail.com", contact: 1742572220 },
    { name: "Setara", email: "Setara@gmail.com", contact: 1742572220 },
  ];

  return (
    <>
      <Container className="text-center">
        <h2> Handle Array With List</h2>

        <Table striped bordered hover variant='dark'>
          <thead>
            <tr>
              <th> Name</th>
              <th>Email</th>
              <th>Contact</th>
            </tr>
          </thead>
          <tbody>
            {students.map((data) => (
              <tr>
                <td>{data.name}</td>
                <td>{data.email}</td>
                <td>{data.contact}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      </Container>
    </>
  );
};

export default App;
